import React, { Component } from 'react'
import cardImg from '../images/maincard.png';
import Navbar from './Navbar';
export default class MainCard extends Component {
    render() {
        return (
            <div>
            <div
                    class="card pmd-card" style={{margin:'0px' , padding}}>
                    <Navbar />
          <img
            src={cardImg}
            alt="About"
            class="pmd-card-media"
            style={{ height: "82.5vh" }}
                    />
                    
          <div
            class="card-img-overlay">
            
          </div>
        </div>
      </div>
                
        )
    }
}
